import React from "react";

const Home = () => {
    return (
        <>
            <section>
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-10 mx-auto"> {/* using 10 columns instead of 12 */}
                            <div className="col-md-6">

                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Home;
